import React, { useEffect, useState } from 'react';
import axios from 'axios';

const PartnersComponent = () => {
  const [partners, setPartners] = useState([]);

  useEffect(() => {
    // Remplacez l'URL ci-dessous par l'URL de votre API WordPress
    const apiUrl = 'http://cjezdhm.cluster029.hosting.ovh.net/wp-json/wp/v2/partners';

    axios.get(apiUrl)
      .then(response => {
        setPartners(response.data);
      })
      .catch(error => {
        console.error('Error fetching partners:', error);
      });
  }, []);

  return (
    <div>
      <h2>Partners</h2>
      <div>
        {partners.map(partner => (
          <div key={partner.id}>
            <h3>{partner.title.rendered}</h3>
            <img src={partner.image.url} alt={partner.title.rendered} />
          </div>
        ))}
      </div>
    </div>
  );
};

export default PartnersComponent;
